import styles from './Loading.module.css'; // Import the CSS module

const Loading = () => (
    <body className={styles.custom-body}>
    <div className={styles.ring}> {/* Use styles.ring to apply the CSS module class */}
    Loading
    <span></span>
  </div>
</body>

);

export default Loading;
